    "\n  query HostApplications(\n    $hostSlug: String!\n    $limit: Int!\n    $offset: Int!\n    $orderBy: ChronologicalOrderInput\n    $searchTerm: String\n    $status: HostApplicationStatus\n  ) {\n    host(slug: $hostSlug) {\n      id\n\n      hostApplications(limit: $limit, offset: $offset, orderBy: $orderBy, status: $status, searchTerm: $searchTerm) {\n        offset\n        limit\n        totalCount\n        nodes {\n          id\n          message\n          customData\n          status\n          createdAt\n          account {\n            id\n            legacyId\n            name\n            slug\n            website\n            description\n            type\n            imageUrl\n            createdAt\n            ... on AccountWithHost {\n              ...ProcessHostApplicationFields\n            }\n            memberInvitations(role: [ADMIN]) {\n              id\n              role\n            }\n            admins: members(role: ADMIN) {\n              totalCount\n              nodes {\n                id\n                account {\n                  id\n                  type\n                  slug\n                  name\n                  imageUrl\n                  ...AccountHoverCardFields\n                  emails\n                }\n              }\n            }\n            ...AccountHoverCardFields\n          }\n        }\n      }\n    }\n  }\n  \n  \n": types.HostApplicationsDocument,
