    "\n  fragment HostedCollectiveFields on Account {\n    id\n    legacyId\n    name\n    slug\n    website\n    type\n    currency\n    imageUrl(height: 96)\n    isFrozen\n    tags\n    settings\n    createdAt\n    stats {\n      id\n      balance {\n        valueInCents\n        currency\n      }\n    }\n    ... on AccountWithHost {\n      hostFeesStructure\n      hostFeePercent\n      approvedAt\n      hostAgreements {\n        totalCount\n        nodes {\n          id\n          title\n          attachment {\n            id\n            url\n            name\n            type\n          }\n        }\n      }\n      host {\n        id\n        legacyId\n        name\n      }\n    }\n    ... on AccountWithContributions {\n      totalFinancialContributors\n    }\n    childrenAccounts {\n      nodes {\n        id\n        slug\n        name\n        type\n        stats {\n          id\n          balance {\n            valueInCents\n            currency\n          }\n        }\n        ... on AccountWithHost {\n          hostFeesStructure\n          hostFeePercent\n          approvedAt\n        }\n        members(role: [ADMIN]) {\n          nodes {\n            id\n            account {\n              id\n              ...AccountHoverCardFields\n              emails\n            }\n          }\n        }\n      }\n    }\n    members(role: [ADMIN]) {\n      nodes {\n        id\n        account {\n          id\n          ...AccountHoverCardFields\n          emails\n        }\n      }\n    }\n    ... on AccountWithParent {\n      parent {\n        id\n        slug\n        name\n        ...AccountHoverCardFields\n      }\n    }\n  }\n  \n": types.HostedCollectiveFieldsFragmentDoc,
    "\n  query HostedCollectivesMetadata($hostSlug: String!) {\n    host(slug: $hostSlug) {\n      id\n      all: hostedAccounts(limit: 1, accountType: [COLLECTIVE, FUND]) {\n        totalCount\n      }\n      active: hostedAccounts(limit: 1, accountType: [COLLECTIVE, FUND], isFrozen: false) {\n        totalCount\n      }\n      frozen: hostedAccounts(limit: 1, isFrozen: true) {\n        totalCount\n      }\n      unhosted: hostedAccounts(limit: 1, accountType: [COLLECTIVE, FUND], isUnhosted: true) {\n        totalCount\n      }\n    }\n  }\n": types.HostedCollectivesMetadataDocument,
    "\n  query HostedCollectives(\n    $hostSlug: String!\n    $limit: Int!\n    $offset: Int!\n    $orderBy: OrderByInput\n    $hostFeesStructure: HostFeeStructure\n    $searchTerm: String\n    $type: [AccountType]\n    $isApproved: Boolean\n    $isFrozen: Boolean\n    $isUnhosted: Boolean\n  ) {\n    host(slug: $hostSlug) {\n      id\n      legacyId\n      slug\n      name\n      currency\n      isHost\n      type\n      settings\n      hostFeePercent\n      plan {\n        id\n        hostFees\n        hostFeeSharePercent\n      }\n      hostedAccounts(\n        limit: $limit\n        offset: $offset\n        searchTerm: $searchTerm\n        hostFeesStructure: $hostFeesStructure\n        accountType: $type\n        orderBy: $orderBy\n        isApproved: $isApproved\n        isFrozen: $isFrozen\n        isUnhosted: $isUnhosted\n      ) {\n        offset\n        limit\n        totalCount\n        nodes {\n          id\n          ...HostedCollectiveFields\n        }\n      }\n    }\n  }\n\n  \n": types.HostedCollectivesDocument,
