    "\n  query DashboardContributionsMetadata($slug: String!, $filter: AccountOrdersFilter!) {\n    account(slug: $slug) {\n      id\n      legacyId\n      slug\n      name\n      type\n      settings\n      imageUrl\n      currency\n      ... on AccountWithContributions {\n        canStartResumeContributionsProcess\n        hasResumeContributionsProcessStarted\n      }\n      ... on AccountWithParent {\n        parent {\n          id\n          slug\n          type\n        }\n      }\n      ALL: orders(filter: $filter) {\n        totalCount\n      }\n      RECURRING: orders(filter: $filter, onlyActiveSubscriptions: true, includeIncognito: true) {\n        totalCount\n      }\n      ONETIME: orders(filter: $filter, frequency: ONETIME, status: [PAID], includeIncognito: true, minAmount: 1) {\n        totalCount\n      }\n      CANCELED: orders(filter: $filter, status: [CANCELLED], includeIncognito: true) {\n        totalCount\n      }\n      PAUSED: orders(filter: $filter, status: [PAUSED], includeIncognito: true) {\n        totalCount\n      }\n    }\n  }\n": types.DashboardContributionsMetadataDocument,
    "\n  query DashboardRecurringContributions(\n    $slug: String!\n    $searchTerm: String\n    $offset: Int\n    $limit: Int\n    $filter: AccountOrdersFilter!\n    $frequency: ContributionFrequency\n    $status: [OrderStatus!]\n    $onlyActiveSubscriptions: Boolean\n    $includeIncognito: Boolean\n    $minAmount: Int\n    $maxAmount: Int\n    $paymentMethod: PaymentMethodReferenceInput\n  ) {\n    account(slug: $slug) {\n      id\n      orders(\n        filter: $filter\n        frequency: $frequency\n        status: $status\n        onlyActiveSubscriptions: $onlyActiveSubscriptions\n        includeIncognito: $includeIncognito\n        minAmount: $minAmount\n        maxAmount: $maxAmount\n        searchTerm: $searchTerm\n        offset: $offset\n        limit: $limit\n        paymentMethod: $paymentMethod\n      ) {\n        totalCount\n        nodes {\n          id\n          ...ManagedOrderFields\n        }\n      }\n    }\n  }\n  \n": types.DashboardRecurringContributionsDocument,
    "\n  query CreatePendingContributionModal($slug: String!) {\n    host(slug: $slug) {\n      id\n      legacyId\n      type\n      isHost\n      name\n      slug\n      currency\n      settings\n      hostFeePercent\n      orderAccountingCategories: accountingCategories(kind: [CONTRIBUTION, ADDED_FUNDS]) {\n        nodes {\n          id\n          name\n          friendlyName\n          code\n          kind\n        }\n      }\n      plan {\n        id\n        hostFees\n      }\n      policies {\n        id\n        REQUIRE_2FA_FOR_ADMINS\n      }\n      isTrustedHost\n      vendors {\n        totalCount\n        nodes {\n          id\n          ...VendorFields\n        }\n      }\n    }\n  }\n\n  \n": types.CreatePendingContributionModalDocument,
    "\n  query CreatePendingContributionCollective($slug: String!) {\n    account(slug: $slug) {\n      id\n      type\n      currency\n      childrenAccounts {\n        nodes {\n          id\n          type\n          legacyId\n          isHost\n          name\n          slug\n          currency\n          settings\n          imageUrl\n          ... on AccountWithContributions {\n            tiers {\n              nodes {\n                id\n                slug\n                legacyId\n                name\n              }\n            }\n          }\n        }\n      }\n      ... on AccountWithHost {\n        bankTransfersHostFeePercent: hostFeePercent(paymentMethodType: MANUAL)\n        host {\n          id\n          legacyId\n          vendors(forAccount: { slug: $slug }, limit: 5) {\n            nodes {\n              id\n              slug\n              name\n              type\n              description\n              imageUrl(height: 64)\n            }\n          }\n        }\n      }\n      ... on AccountWithContributions {\n        tiers {\n          nodes {\n            id\n            slug\n            legacyId\n            name\n          }\n        }\n      }\n    }\n  }\n": types.CreatePendingContributionCollectiveDocument,
